import React from 'react'

import { PageWrapper } from 'components'
import { processedImages } from 'config/images'

import {
	HeaderWrapper,
	HeaderSlider,
	HeaderSlide,
	HeaderTitle,
	HeaderSubtitle,
} from './styledComponents'

const headerSliderImages = [
	processedImages[53].full,
	processedImages[97].full,
	processedImages[80].full,
	processedImages[134].full,
	processedImages[26].full,
	processedImages[24].full,
	processedImages[33].full,
]

export const Home = () => {
	return (
		<PageWrapper>
			<HeaderWrapper>
				<HeaderSlider
					dots={true}
					infinite={true}
					speed={1000}
					slidesToShow={1}
					slidesToScroll={1}
					autoplay
				>
					{headerSliderImages.map((image, index) => (
						<HeaderSlide image={image} key={index} />
					))}
				</HeaderSlider>
				<HeaderTitle>We're Engaged!</HeaderTitle>
				<HeaderSubtitle>Tying the knot July 18th 2020.</HeaderSubtitle>
			</HeaderWrapper>
		</PageWrapper>
	)
}
